import React from 'react';
import { ReactComponent as Check } from '../../assets/icons/check.svg';
import checked from '../../assets/images/checked-icon.png'

function Courses() {
    return (
        <div>
            <h4 className="courses-title">COURSES</h4>
            <ul className="apply-flex-row" style={{ justifyContent: 'space-around' }}>
                <div className="tech-used apply-flex-column">
                    {/* <li><Check className="courses-icons" />JavaScript Fundamentals - Telecom Academy</li> */}
                    <li className="apply-flex-row">
                        <img src={checked} className="courses-icons"/>
                        <p>JavaScript Fundamentals - Telecom Academy</p>
                    </li>
                    {/* <li><Check className="courses-icons" />JavaScript Advanced - React - Telecom Academy</li> */}
                    <li className="apply-flex-row">
                        <img src={checked} className="courses-icons" />
                        <p>JavaScript Advanced - React - Telecom Academy</p>
                    </li>
                </div>
                <div className="tech-used apply-flex-column">
                    {/* <li><Check className="courses-icons" />The Web Developer Bootcamp - Udemy</li> */}
                    <li className="apply-flex-row">
                        <img src={checked} className="courses-icons" />
                        <p>The Web Developer Bootcamp - Udemy</p>
                    </li>
                    {/* <li><Check className="courses-icons" />Modern React with Redux - Udemy</li> */}
                    <li className="apply-flex-row">
                        <img src={checked} className="courses-icons" />
                        <p style={{alignSelf: 'center'}}>Modern React with Redux - Udemy</p>
                    </li>
                </div>
            </ul>
        </div>
    );
};

export default Courses;
